import React, { Component } from "react";
import "./Cards.css";

class Cards extends Component {
  render() {
    return (
      <div className="card-box ">
        <div className="card-img">
          <img src="" alt="card-img" />
        </div>
        <div className="card-title">
          <div>
            <img src="" alt="profile-pic" />
          </div>
          <div>
            <H1>Sehbaz</H1>
          </div>
        </div>
      </div>
    );
  }
}
export default Cards;
